import "./home.css";

const Home = (prop) => {
  return (
    <div className="home-container">
      <div className="home-left-panel"></div>
      <div className="Right">
        <h3>Who are we?</h3>
        <p>
          Piano & Forte is an afterschool music and mentoring program currently
          offerred in the select Prince George County Public Schools that
          provides disadvantaged elementary school students with a UMD mentor
          who helps the youner child who would otherwise not be able to afford
          lessons, learn music.
        </p>
        <h3>Who can join us as a volunteer teacher?</h3>
        <p>
          If you're a student looking for a meaningful way to earn volunteer
          hours or piano teaching experience, this opportunity is for you!
        </p>
      </div>
    </div>
  );
};

export default Home;
